uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_twist; 
uniform float u_petals; 
uniform float u_hue;   
uniform float u_hue2;  

out vec4 fragColor;

// --- Helper Functions ---

vec3 hsb2rgb(vec3 c) {
    vec3 rgb = clamp(abs(mod(c.x * 6.0 + vec3(0.0, 4.0, 2.0), 6.0) - 3.0) - 1.0, 0.0, 1.0);
    rgb = rgb * rgb * (3.0 - 2.0 * rgb);
    return c.z * mix(vec3(1.0), rgb, c.y);
}

// Lush Pastel Palette
vec3 getPastelColor(float hue, float z) {
    float sat = mix(0.45, 0.25, z); 
    float bri = mix(1.1, 0.6, z); 
    return hsb2rgb(vec3(hue, sat, bri));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;

    // Params
    float spd = (u_speed <= 0.0) ? 0.3 : u_speed;
    float time = iTime * spd;

    // THE FIX: Round the petals to the nearest whole number.
    // This prevents the "seam" on the left side of the screen.
    float petalCount = (u_petals <= 0.0) ? 5.0 : floor(u_petals);

    float twistAmt = (u_twist == 0.0) ? 0.0 : u_twist; 
    float hueNear = (u_hue == 0.0) ? 0.55 : u_hue; 
    float hueFar = (u_hue2 == 0.0) ? 0.85 : u_hue2; 

    // Background: Deep Dark Space
    vec3 finalColor = vec3(0.02, 0.015, 0.04);

    // Polar Coordinates
    float angle = atan(uv.y, uv.x);
    float radius = length(uv);

    const int LAYERS = 60; 

    for(int i = LAYERS; i > 0; i--) {

        // Perspective Z
        float zIndex = float(i) - fract(time * 0.8); 
        float z = zIndex * 0.15; 

        if(z < 0.1) continue; 

        float projection = 1.0 / z;

        // --- VORTEX SHAPE LOGIC ---

        // 1. Rotation (Twist)
        float currentAngle = angle + z * twistAmt + time * 0.5;

        // 2. Petal Wave
        // Using the integer 'petalCount' ensures the wave matches up perfectly at the seam
        float wave = sin(currentAngle * petalCount); 

        // Secondary wave (integer multiplier 3.0 is also safe)
        wave += sin(currentAngle * 3.0 - time * 2.0) * 0.5;

        // 3. Ring Radius
        float ringRadius = 0.5 + 0.1 * wave;

        // 4. Project to Screen
        float screenRadius = ringRadius * projection * 0.4;

        // --- Visuals ---

        float dist = abs(radius - screenRadius);
        float thickness = 0.008 * projection; 

        // Glow
        float lineGlow = exp(-dist / thickness) * 1.5;

        // Fog 
        float fog = smoothstep(0.0, 0.7, projection); 

        // Color
        float currentHue = mix(hueNear, hueFar, clamp(z * 0.15, 0.0, 1.0));
        vec3 col = getPastelColor(currentHue, clamp(z * 0.1, 0.0, 1.0));

        // Composition
        finalColor += col * lineGlow * fog;

        // Fill
        float fill = smoothstep(thickness * 3.0, 0.0, dist);
        finalColor += col * fill * 0.02 * fog * projection;
    }

    // Center Glow
    vec3 farCol = hsb2rgb(vec3(hueFar, 0.3, 1.0));
    float centerGlow = exp(-radius * 5.0);
    finalColor += farCol * centerGlow * 0.5;

    // Post-Processing
    finalColor *= 1.2 - length(uv0) * 0.6; 
    finalColor = clamp(finalColor, 0.0, 1.0);
    finalColor = pow(finalColor, vec3(0.9)); 

    fragColor = vec4(finalColor, 1.0);
}

